import Vue from 'vue'
import Router from 'vue-router'

import Main from '@/views/main/main.vue'

Vue.use(Router)

export default new Router({
	routes: [

		{
			path: '/',
		    redirect: '/home', 
		    name: 'otherRouter',
		    component: Main,
		    children: [
			    {
			    	path: 'home',
		            title: '扶뒬못',
		            name: 'home_index',
		            component: () => import('@/views/home.vue')
			    }
			]
		}
	]
})
